import React from "react";
import styled from "styled-components";
import { FiArrowRight } from "react-icons/fi";
/*const NavbarTemplate = styled.div`
  position: fixed;
  width: 100%;
  height: 120px;
  top: 0;
  margin: 0;
  background-color: #fff;
  z-index: 3;
`;*/

const NavbarContainer = styled.div`
  position: fixed;
  width: 100%;
  box-sizing: border-box;
  height: 120px;
  margin: 0 auto;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding-left: 40px;
  padding-right: 40px;
  z-index: 3;
  background: #fff;
`;

const NavECText = styled.span`
  display: inline-block;
  font-size: 1.5rem;
  color: #101010;
  font-weight: bold;
  white-space: nowrap;
`;

const NavMenu = styled.ul`
  padding: 0;
  margin: 0;
  display: flex;
  list-style: none;
  li:not(:nth-child(1)) {
    padding-left: 32px;
  }
  li:nth-child(4) {
    opacity: 0.2;
  }
`;

const NavMenuText = styled.li`
  a {
    text-decoration: none;
    color: #101010;
  }
`;

const NavToggle = styled.a`
  display: none;
  position: absolute;
  right: 80px;
  span:nth-child(1) {
    top: -5px;
  }
  span:nth-child(2),
  span:nth-child(3) {
    top: 5px;
  }
  span:nth-child(4) {
    top: 15px;
  }
`;
const NavToggleBtn = styled.span`
  position: absolute;
  transition: 0.3s ease-in-out;
  height: 4px;
  width: 30px;
  border-radius: 7px;
  background-color: #3d4146;
  top: 0;
  transition: 0.3s;
`;

function Main_Navbar() {
  return (
    <NavbarContainer>
      <NavECText>Endless Creation</NavECText>
      <NavMenu>
        <NavMenuText>
          <a href="#">Activity</a>
        </NavMenuText>
        <NavMenuText>
          <a href="#">Project</a>
        </NavMenuText>
        <NavMenuText>
          <a href="#">Member</a>
        </NavMenuText>
        <NavMenuText>
          <a href="#">
            community{" "}
            <div className="ArrowRight">
              <FiArrowRight />
            </div>
          </a>
        </NavMenuText>
      </NavMenu>
      <NavToggle>
        <NavToggleBtn />
        <NavToggleBtn />
        <NavToggleBtn />
        <NavToggleBtn />
      </NavToggle>
    </NavbarContainer>
  );
}

export default Main_Navbar;
